import React from 'react';

const PROJECTS = [
  {
    title: "Portfolio Website",
    description: "A modern, responsive portfolio built with React and styled-components. Features smooth animations, a skills showcase, and contact form.",
    image: "/assets/projects/portfolio.png",
    tech: ["React", "CSS", "JavaScript"],
    link: "https://github.com/yourusername/portfolio-website"
  },
  {
    title: "Task Manager App",
    description: "A full-stack MERN application for managing daily tasks, with authentication and real-time updates.",
    image: "/assets/projects/taskmanager.png",
    tech: ["MongoDB", "Express", "React", "Node.js"],
    link: "https://github.com/yourusername/task-manager"
  },
  {
    title: "UI Design System",
    description: "Reusable UI components and design assets for rapid prototyping and consistent branding.",
    image: "/assets/projects/designsystem.png",
    tech: ["Figma", "React", "Tailwind"],
    link: "https://github.com/yourusername/ui-design-system"
  }
];

export default function Projects() {
  return (
    <section id="projects" className="projects-section container card">
      <div className="projects-header">
        <h2 className="section-title">Projects</h2>
        <p className="muted">Some of my featured work</p>
      </div>
      <div className="projects-grid">
        {PROJECTS.map((project) => (
          <div className="project-card" key={project.title}>
            <div className="project-image-wrapper">
              <img
                src={project.image}
                alt={project.title}
                className="project-image"
                loading="lazy"
              />
            </div>
            <div className="project-info">
              <h3 className="project-title">{project.title}</h3>
              <p className="project-desc">{project.description}</p>
              <div className="project-tech">
                {project.tech.map((tech) => (
                  <span className="tech-badge" key={tech}>{tech}</span>
                ))}
              </div>
              <a
                href={project.link}
                className="project-link"
                target="_blank"
                rel="noopener noreferrer"
              >
                View Code
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
